import React, { useState } from "react";
import "../Css/Navbar.css"; // Adjust the path as necessary

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <header className="navbar">
      <div className="navbar-left">
        <span className="blue-square"></span>
        <h1 className="name">Qasham Ahmed</h1>
        <span className="divider">/</span>
        <span className="title">Project Manager</span>
      </div>
      <nav className={`navbar-right ${menuOpen ? "open" : ""}`}>
        <a href="#about" className="active">About Me</a>
        <a href="#resume">Resume</a>
        <a href="#projects">Projects</a>
        <a href="#contact">Contact</a>
      </nav>
      <div
        className="menu-toggle"
        onClick={() => setMenuOpen(!menuOpen)}
      >
        â˜°
      </div>
    </header>
  );
};

export default Navbar;
